import React from "react";

const Buttons = (props) => {
  return (
    <div className="button-field">
      <button
        type="primary"
        danger
        className="quiz-button"
        onClick={props.returnQuestion}
      >
        戻る
      </button>
      <button
        type="primary"
        className="quiz-button"
        onClick={props.nextQuestion}
      >
        次へ
      </button>
    </div>
  );
};

export default Buttons;
